Description.Desc:
Press <IconMap:Icon_Special> to activate:
Thrust forward and perform a tail attack, dealing <color=#FF5521>Fire DMG</color>;
Anti-Interrupt level is increased while using this skill.

Automatically triggers when allies attack:
Unleashes 4 laser Aftershocks dealing <color=#FF5521>Fire DMG</color>;
Can be triggered once every 5 seconds;
Character is invulnerable while using this skill and recovers 20 Bottled Heat.

With enough Energy, press <IconMap:Icon_SpecialReady> to activate:
Unleash a laser sweep forward, dealing <color=#FF5521>Fire DMG</color>;
After using this skill, immediately follow up with a powerful fire blade from Basic Attack;
Upon activating this skill, restore 20 points of [Bottled Heat];
Character is invulnerable while using this skill.

When off-field with 60 or more Energy, automatically activates when allies attack:
Performs a laser sweep in all directions, dealing <color=#FF5521>Fire DMG</color>;
Upon activating this skill, restore 20 Bottled Heat;
Character is invulnerable while using this skill.

When [Bottled Heat] is â‰¥100, hold <IconMap:Icon_Special> to activate:
Consume 100 [Bottled Heat] to continuously fire a laser forward, dealing <color=#FF5521>Fire DMG</color>;
When firing begins, triggers <color=#FFFFFF>[Quick Assist]</color>;
After continuous firing for a period, firepower increases, significantly boosting the skill's Interrupt Level;
When attacked during firing, parries enemy attacks and immediately increases firepower;
When maximum firing duration is reached, automatically activates [EX Special Attack: Blazing Burst];
During low firepower phase, Anti-Interrupt Level increases and DMG taken is reduced by 40%, while character is invulnerable during high firepower phase.

[EX Special Attack: Heat Charge] Auto-activates after max charge time:
Performs a spinning attack forward, then fires a laser ahead dealing <color=#FF5521>Fire DMG</color>;
Character is invulnerable while using this skill.

When a <color=#FFFFFF>Chain Attack</color> is triggered, select the character to activate:
Perform a spinning attack forward, then fire a laser ahead dealing <color=#FF5521>Fire DMG</color>;
Upon activating this skill, restore 20 points of [Bottled Heat];
Character is invulnerable while using this skill.

When Decibel Rating is at <color=#FFFFFF>Maximum</color>, press <IconMap:Icon_UltimateReady> to activate:
Perform a spinning attack forward, then fire a laser ahead, dealing <color=#FF5521>Fire DMG</color>;
When leaping into the air, a <color=#FFFFFF>Quick Assist</color> will be triggered. If the <color=#FFFFFF>Quick Assist</color> is triggered, Orphie & Magus will extend the laser firing duration;
Character is invulnerable while using this skill.

When the active character is launched, press <IconMap:Icon_Switch> to activate:
Unleash a combo attack on enemies in front, dealing <color=#F0D12B>Physical DMG</color> and <color=#FF5521>Fire DMG</color>;
Character is invulnerable while using this skill.

